import React from 'react'
import { Search } from './Search'
import { Job } from './Job'

export const JobsContainer = (props) => {
    return (
        <div>
            <Search />
            <h1>Jobs Container</h1>
            {props?.jobs.map((job)=>{
                <Job job={job} />
            })}
        </div>
    )
}
